import React from 'react'

export default function (Component) {
  return class withAuth extends React.Component {
    alertMessage () {
      alert('Some Message!!!!')
    }

    render () {
      const someVariable1 = '1'
      const someVariable2 = '2'

      return <Component {...this.props} />
    }
  }
}
